.accordion__button:before {

uld click on Reset filter button and all the products should displayed in card view\r\n    Then User enters Product# in Search bar in Catalog popup and enter Qty card view\r\n      |1|\r\n      |1|\r\n      |2|\r\n    Then User click on cart and click on Checkout to order\r\n    And Login to Application and Select customer account from popup\r\n    Then User should navigate to My Cart and click on Chekout to order button\r\n    And user should be on New Order entry page\r\n    Then Enter PO# for New order\r\n      |PO123|\r\n    Then Click on Next button and select option Continue without payment option\r\n    And Click on Submit Order button and read Order_no\r\n    Then User should be navigated to Order Entry page\r\n    Then Click on user Icon on Order Entry page\r\n    And Click on Logout on Order Entry page\r\n\r\n  @ProductsCatalogListView\r\n  Scenario: Adding product to cart, using list view\r\n    Given User on login page for external catalog\r\n    When User clicks on View product catalog and Product catalog should be displayed\r\n    And user should click on Reset filter button and all the products should displayed in List view\r\n    Then User enters Product# in Search bar in Catalog popup and enter Qty List view\r\n      |1|\r\n      |2|\r\n      |1|\r\n    Then User click on cart and click on Checkout to order\r\n    And Login to Application and Select customer account from popup\r\n    Then User should navigate to My Cart and click on Chekout to order button\r\n    And user should be on New Order entry page\r\n    Then Enter PO# for New order\r\n      |PO123|\r\n    Then Click on Next button and select option Continue without payment option\r\n    And Click on Submit Order button and read Order_no\r\n    Then User should be navigated to Order Entry page\r\n    Then Click on user Icon on Order Entry page\r\n    And Click on Logout on Order Entry page\r\n\r\n  @DeleteProductsAddByDeleteIcon\r\n  Scenario: Add products to cart from external catalog, Delete added product using Delete Icon. Here Card view is used\r\n    Given User on login page for external catalog\r\n    When User clicks on View product catalog and Product catalog should be displayed\r\n    And user should click on Reset filter button and all the products should displayed in card view\r\n    Then User enters Product# in Search bar in Catalog popup and enter Qty and delete the first product added\r\n      |1|\r\n      |1|\r\n      |2|\r\n    Then User click on cart and click on Checkout to order\r\n    And Login to Application and Select customer account from popup\r\n    Then User should navigate to My Cart and click on Chekout to order button\r\n    And user should be on New Order entry page\r\n    Then Enter PO# for New order\r\n      |PO123|\r\n    Then Click on Next button and select option Continue without payment option\r\n    And Click on Submit Order button and read Order_no\r\n    Then User should be navigated to Order Entry page\r\n    Then Click on user Icon on Order Entry page\r\n    And Click on Logout on Order Entry page\r\n\r\n  @SortByBestMatch\r\n  Scenario: Sorting of items in ascending order\r\n    Given User on login page for external catalog\r\n    When User clicks on View product catalog and Product catalog should be displayed\r\n    And user should click on Reset filter button and all the products should displayed in List view\r\n    Then Click on sort by best match and select ascending order and verify the same\r\n      |Sort by price (ascending)|\r\n\r\n  @DeleteItemsInCart\r\n  Scenario: Add product to cart from external catalog and delete one of the product from Items in Cart page\r\n    Given User on login page for external catalog\r\n    When User clicks on View product catalog and Product catalog should be displayed\r\n    And user should click on Reset filter button and all the products should displayed in card view\r\n    Then User enters Product# in Search bar in Catalog popup and enter Qty card view\r\n      |1|\r\n r valid user name and password, Validate Home page Test\r\n    Given User on login page\r\n    Then User entered username and password\r\n    Then Admin Page is displayed\r\n    Then Click on user Icon\r\n    And Click on Logout\r\n\r\n  @Logout\r\n  Scenario:Loging out from the application\r\n    Given User on login page\r\n    Then User entered username and password\r\n    Then Admin Page is displayed\r\n    Then Click on user Icon\r\n    And Click on Logout\r\n\r\n  @RegistrationCancel\r\n  Scenario Outline: Enter all the details in Registration input boxes and cancel button\r\n    Given User should verify admin setting \"\u003cSetting\u003e\" is enabled by using \"\u003cKey\u003e\" in common and company\r\n    Given User on login page\r\n    And Click on Register here link\r\n    Then Customer Registration page should get displayed\r\n    And Enter values in input boxes\r\n    Then click on Cancel button\r\n    Examples:\r\n      | Setting              | Key                      |\r\n      | Registration message | CPEnableUserRegistration |\r\n\r\n#This is based on admin setting\r\n  @RegistrationAccount\r\n  Scenario Outline: Registration of user using  Customer account#\r\n    Given User should verify admin setting \"\u003cSetting\u003e\" is enabled by using \"\u003cKey\u003e\" in common and company\r\n    Given User on login page\r\n    And Click on Register here link\r\n    Then Customer Registration page should get displayed\r\n    And Enter values in input boxes\r\n    Then click on Register button\r\n    Then If user is navigated to OE page Logout from application\r\n    Examples:\r\n      | Setting              | Key                      |\r\n      | Registration message | CPEnableUserRegistration |\r\n\r\n  @DonotHaveAccount\r\n  Scenario Outline: Allowing new customer to register when not having an account\r\n    Given User should verify admin setting \"\u003cSetting\u003e\" is enabled by using \"\u003cKey\u003e\" in common and company\r\n    Given User on login page\r\n    And Click on Register here link\r\n    Then Customer Registration page should get displayed\r\n    And Click on Donot have account check box, Then Enter values in input boxes\r\n    Then click on Register button\r\n    Examples:\r\n      | Setting              | Key                      |\r\n      | Registration message | CPEnableUserRegistration |\r\n\r\n  @DonotHaveAccountCancel\r\n  Scenario Outline: Allowing new customer to register when not having an account,cancel option\r\n    Given User should verify admin setting \"\u003cSetting\u003e\" is enabled by using \"\u003cKey\u003e\" in common and company\r\n    Given User on login page\r\n    And Click on Register here link\r\n    Then Customer Registration page should get displayed\r\n    And Click on Donot have account check box, Then Enter values in input boxes\r\n    Then click on Cancel button\r\n    Examples:\r\n      | Setting              | Key                      |\r\n      | Registration message | CPEnableUserRegistration |\r\n\r\n  @ForeignLanguage\r\n  Scenario: Check for display of details in foreign language\r\n    Given User on login page\r\n    Then User entered username and password\r\n    Then Admin Page is displayed\r\n    Then Click on user Icon\r\n    Then User changes language to some other language option and validates language\r\n    Then Click on user Icon\r\n    And User resetting language back to\r\n      |English (USA)|\r\n    Then Click on user Icon\r\n    And Click on Logout\r\n\r\n  @Verify_Client_AdminLogin\r\n  Scenario: Login as Admin once, Login as Client once and verify landing pages\r\n    Given User on login page\r\n    Then User entered username and password\r\n    Then Admin Page is displayed\r\n    Then Click on user Icon\r\n    And Click on Logout\r\n    Then user enters admin username and password\r\n    And User should be navigated to Admin page\r\n    Then Click on user Icon\r\n    And Click on Logout\r\n\r\n\r\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/Divya.Ramadas/IdeaProjects/ignition-qa/AFS_Automation/OMS_Automation/src/test/resources/features_DSD_OMS/LoginFeature/loginFeature.feature","feature":{"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Login","children":[{"background":{"location":{"line":3,"column":3},"keyword":"Background","name":"For login to application","steps":[{"location":{"line":4,"column":5},"keyword":"Given ","text":"User enters URL and is on login page","id":"988f597e-b6a9-409b-b992-4272a7c66308"}],"id":"26d26217-d613-49aa-bd78-bf0e7089f2dd"}},{"scenario":{"location":{"line":7,"column":3},"tags":[{"location":{"line":6,"column":3},"name":"@InvalidCredentials","id":"1ee2b494-6052-47b1-ab38-95ce55cb6fa5"}],"keyword":"Scenario Outline","name":"Invalid userid and password","steps":[{"location":{"line":8,"column":5},"keyword":"Given ","text":"User on login page","id":"530130eb-039c-42a0-9c37-1529d73aba62"},{"location":{"line":9,"column":5},"keyword":"Then ","text":"User entered Invalid \"\u003cusername\u003e\" and \"\u003cpassword\u003e\"","id":"45c897ed-5e03-4aad-b91d-64b02f62356b"},{"location":{"line":10,"column":5},"keyword":"Then ","text":"Check for warning message","id":"d3430fd7-8fd5-4fb6-a9cd-2a8a57b193de"}],"examples":[{"location":{"line":11,"column":5},"keyword":"Examples","tableHeader":{"location":{"line":12,"column":7},"cells":[{"location":{"line":12,"column":9},"value":"username"},{"location":{"line":12,"column":20},"value":"password"}],"id":"276b88c2-31d1-434f-aea5-bacc5623d01d"},"tableBody":[{"location":{"line":13,"column":7},"cells":[{"location":{"line":13,"column":9},"value":"!@##$@#$"},{"location":{"line":13,"column":20},"value":"@$@#$$%#$"}],"id":"25027ea3-6de6-4f8a-8f80-603f43a2ea7f"},{"location":{"line":14,"column":7},"cells":[{"location":{"line":14,"column":9},"value":"12738172"},{"location":{"line":14,"column":20},"value":"723472423"}],"id":"a6de92b9-b5c4-4a94-ad6f-c55541c565dc"},{"location"
